import{_ as e,c as a,o,ag as r}from"./chunks/framework.C7v41-tM.js";const h=JSON.parse('{"title":"RN 0.39 xcode 启动模拟器踩坑点","description":"","frontmatter":{},"headers":[],"relativePath":"前端/rn_ios.md","filePath":"前端/rn_ios.md","lastUpdated":1763002213000}'),d={name:"前端/rn_ios.md"};function i(l,t,n,s,c,x){return o(),a("div",null,[...t[0]||(t[0]=[r('<h1 id="rn-0-39-xcode-启动模拟器踩坑点" tabindex="-1">RN 0.39 xcode 启动模拟器踩坑点 <a class="header-anchor" href="#rn-0-39-xcode-启动模拟器踩坑点" aria-label="Permalink to &quot;RN 0.39 xcode 启动模拟器踩坑点&quot;">​</a></h1><h2 id="引入本地依赖导致-导致本地模块出现-xxxx-h-not-found" tabindex="-1">引入本地依赖导致 导致本地模块出现 xxxx.h not found？ <a class="header-anchor" href="#引入本地依赖导致-导致本地模块出现-xxxx-h-not-found" aria-label="Permalink to &quot;引入本地依赖导致 导致本地模块出现 xxxx.h not found？&quot;">​</a></h2><p>本地可能需要连接本地模块开发，通过本地路径林杰， 但是启动的时候报 &quot;xxxx.h not found&quot;, 原因是 xcode 会通过header search path 查找 本地链接路径并非基于node_modules 而是 依赖所在问目录</p><p><code>解决</code> xcode: 查看lib 找到对应的lib build setting -&gt; paths -&gt; Header search paths 查看是否路径会执行 主项目的node_modules/react_native下</p><h2 id="部分引入的lib-不支持arm-64" tabindex="-1">部分引入的lib 不支持arm 64 <a class="header-anchor" href="#部分引入的lib-不支持arm-64" aria-label="Permalink to &quot;部分引入的lib 不支持arm 64&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">build 出现以下错误</p><p>Building for &#39;iOS-simulator&#39;, but linking in object file (/Users/wei.wang/Library/Developer/Xcode/DerivedData/OTRASTabletApp-ffxyfmpropogarcxlgenjxycruvc/Build/Products/Debug-iphonesimulator/libRNScanner.a[9] (IDCardCoreProject.o)) built for &#39;iOS&#39;</p></div><p><code>解决</code> build setting -&gt; Architectures -&gt; Excluded Architectures -&gt; 选择 any ios or iOS-simulator SDK 值输入为arm64, 这样在选择simulator 就会多 rosetta 版本（Rosetta 是 macOS 上的 “翻译器”，它能让 Intel 架构的程序 在 ARM 芯片（Apple Silicon） 上运行）</p><h2 id="常用快捷键" tabindex="-1">常用快捷键 <a class="header-anchor" href="#常用快捷键" aria-label="Permalink to &quot;常用快捷键&quot;">​</a></h2><table tabindex="0"><thead><tr><th>功能</th><th>快捷键</th><th>等同于命令</th></tr></thead><tbody><tr><td>clean</td><td><strong>⌘ + ⇧ +K</strong></td><td>xcodebuild clean -project ios/xxx.xcodeproj -alltargets</td></tr><tr><td>build</td><td><strong>⌘ + ⇧ + R</strong></td><td>xcodebuild build -project ios/xxx.xcodeproj -alltargets</td></tr><tr><td>reload js</td><td><strong>⌘ + R</strong></td><td></td></tr></tbody></table>',9)])])}const p=e(d,[["render",i]]);export{h as __pageData,p as default};
